import React, { Component } from "react";

export default class Logo extends Component {
	constructor (props) {
		super(props)
	}

	render (){
		return(
			<div className="flex-none">
				<a className="btn btn-ghost normal-case text-xl text-white" href='#'>{this.props.name}</a>
			</div>
		)
		
		
	}
}
